import styled from 'styled-components';

const Container = styled.div`
    width: 100vw;
    height: 157px;
    position: relative;
    overflow: hidden;
    background: rgb(46, 48, 50);
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 0 120px;
    box-sizing: border-box;
`;

const ContactSection = styled.section`
    display: flex;
    flex-direction: column;
    align-items: flex-start;
`;

const ContactInfo = styled.p`
    font-size: 20px;
    color: #6c757d;
    margin: 0;
    &:not(:last-child) {
        margin-bottom: 16px;
    }
`;

const ContactLabel = styled.span`
    font-weight: bold;
    color: #000;
`;

const FooterText = styled.p`
    position: absolute;
    left: 112px;
    top: 26px;
    font-size: 16px;
    text-align: left;
    color: #fff;
`;

export default function Bottom() {
    return (
        <Container>
            <ContactSection>
                <ContactInfo>
                    <ContactLabel>ADDRESS:</ContactLabel> 경기도 안산시 단원구 원포공원로 59, 신명트윈타워 A동 5층 15호
                </ContactInfo>
                <ContactInfo>
                    <ContactLabel>PHONE:</ContactLabel> 010-5219-8234
                </ContactInfo>
                <ContactInfo>
                    <ContactLabel>EMAIL:</ContactLabel> sfs230@hanmail.net
                </ContactInfo>
            </ContactSection>
            <FooterText>DaonTech © 2024. All Rights Reserved</FooterText>
        </Container>
    );
}
